import React, { useState } from 'react';

function Homepage() {
  const [setCount, count] = useState(0);
  console.log('state', count)
  return (
    <div>
      <div className='container'>
        <a className="btn-floating btn-large waves-effect waves-light blue" onClick={() => setCount(count + 1)}><i class="material-icons">add</i></a>
        <span className="new badge" data-badge-caption="jobs">{count}sfd</span>
      </div>
    </div>
  );
}

export default Homepage;
